# -*- coding:UTF-8 -*-
import gmpy2
import sympy.crypto.crypto


def foo(n):
    x = gmpy2.iroot(n, 2)[0]
    p = sympy.crypto.crypto.nextprime(x)
    q = n // p
    return p, q


def isqrt(n):
    x = n
    y = (x + n // x) // 2
    while y < x:
        x = y
        y = (x + n // x) // 2
    return x


def fermat(n):
    a = isqrt(n)
    b2 = a * a - n
    b = isqrt(b2)
    count = 0
    while b * b != b2:
        a = a + 1
        b2 = a * a - n
        b = isqrt(b2)
        count += 1
    p = a + b
    q = a - b
    assert n == p * q
    return p, q


n = int('''

''')
p, q = fermat(n)
print("p = {}\nq = {}".format(p, q))
